--[[Description
<p>The Name Action Plugin is a great asset for anyone making an RPG or any game for that matter.<br/>
This plugin can make your NPCs have random common names or even unique names making it an indipensible plugin for any AMS game developer.
</p>
]]
--[[Features
<ul class="comments_list_features">
	<li>Can return a list of all stored names</li>
	<li>Capable of selecting random names from the stored list</li>
	<li>Capable of generating unique random names on the fly</li>
</ul>
]]
--[[Version History
<p><b>Version 1.0.0.0</b></p>
<p>Converted the script to a plugin.</p>
<p>Added several new names.</p>
<p><b>Version 1.1.0.0</b></p>
<p>Removed redundant entries.</p>
]]
