NAME_TYPE_DOUBLE_VOWEL = 3;
NAME_TYPE_DOUBLE_CONSONANT = 4;


local CHAR_VOW = 1;
local CHAR_CON = 2;
local CHAR_SPE = 3;
local CHAR_LAST_TYPE = 0;

local tLetters = {"a","b","c","d","e","f","g","h","i","j","k","l","m","n","o","p","q","r","s","t","u","v","w","x","y","z"};
local nLetters = #tLetters;

local tVowels = {"a","a","a","e","e","e","i","i","i","o","o","u","y"};
local nVowels = #tVowels;

local tConsonants = {"b","c","d","f","g","h","j","k","l","m","n","p","q","r","s","t","v","w","x","z"};
local nConsonants = #tConsonants;

local tLettersSplit = {
[CHAR_VOW] = {"a","a","a","e","e","e","i","i","i","o","o","u","y"},
[CHAR_CON] = {"b","c","d","f","g","h","j","k","l","m","n","p","q","r","s","t","v","w","x","z"},
};

--add the other consonant sounds
local tAddatives = {"h","j","l","r"};
local nAddatives = #tAddatives;

for x = 1, 24 do

	for y = 1, nAddatives do
		tLettersSplit[CHAR_CON][#tLettersSplit[CHAR_CON] + 1] = tLettersSplit[CHAR_CON][x]..tAddatives[y];
	end

end

