--[[This is a utility function for checking the
	integrity of the names table.

	If the table of names is correctly sorted,
	this should return an empty table. If any
	entries are returned, they should be looked
	at and corrected.
--]]
function getOutOfOrderNames()
	local tRet = {};

	for sClass, tLetters in pairs(tAllNames) do	--all names classes

		for sLetter, tNames in pairs(tLetters) do --all letters

			for nIndex, sName in pairs(tNames) do --each name

				--get the first letter's occurrance
				local nStart, nEnd = sName:find('[%a]');

				--if it's not the correct letter, add it to the return table
				if sName:sub(nStart, nStart):lower() ~= sLetter then
					tRet[#tRet + 1] = sName..' (class: '..sClass..' letter: '..sLetter..')';
				end

			end

		end

	end

	return tRet;
end



--[[This is a utility function for checking the
	integrity of the names table.

	If the table of names has no duplicates,
	this should return an empty table. If any
	entries are returned, they should be looked
	at and corrected.
--]]
function getDuplicateNames()
	local tRet = {};

	for sClass, tLetters in pairs(tAllNames) do	--all names classes

		for sLetter, tNames in pairs(tLetters) do --all letters

			for nSuspectID, sSuspectName in pairs(tNames) do --each name

				for nQueryID, sQueryName in pairs(tNames) do --each name (again)

					if nSuspectID ~= nQueryID then --if this is not the current suspect's ID

						--if it's a duplicate, add it to the return table
						if sSuspectName:lower() == sQueryName:lower() then
							tRet[#tRet + 1] = sQueryName..' (class: '..sClass..' letter: '..sLetter..')';
						end

					end

				end

			end

		end

	end

	return tRet;
end


