--=========================
-- name.Generate
--=========================
function name.generate(nType, nLength)

	local sRet = "";
	local nLastType = 1;

		if nType == 1 then
		sRet = sRet..name.randomVow();

		elseif nType == 2 then
		sRet = sRet..name.randomCon();
		nLastType = 2;

		elseif nType == 3 then
		sRet = sRet..name.randomVow();
		sRet = sRet..name.randomVow();

		elseif nType == 4 then
		sRet = sRet..name.randomCon();
		sRet = sRet..name.randomCon();
		nLastType = 2;

		end

		if sRet == "Y" then
		sRet = "Y'";
		end

		sRet = string.upper(sRet);

		for x = 1, nLength do
		local nRand = math.random(1, 1000);

			if nLastType == 1 then
			sRet = sRet..name.randomCon();

				if nRand > 900 then

					if nRand > 975 then
					sRet = sRet..name.randomCon();
					else
					sRet = sRet..name.randomVow();
					end

				end

			nLastType = 2;

			elseif nLastType == 2 then
			sRet = sRet..name.randomVow();

				if nRand > 900 then

					if nRand > 950 then
					sRet = sRet..name.randomCon();
					else
					sRet = sRet..name.randomVow();
					end

				end

			nLastType = 1;

			end

		end

	return sRet
end



