--=========================
-- name.getRandom
--=========================
function name.getRandom(sClass, sLetter)
	sClass = (type(sClass)	== "string") and sClass or "*";
	sClass = (sClass:gsub("%s",  "")  ~= "") and sClass:lower() or "*";
	local bRandomClass = true;

	sLetter = (type(sLetter)	== "string") and sLetter or "*";
	sLetter = (sLetter:gsub("%s",  "")  ~= "") and sLetter:lower() or "*";
	local bRandomLetter = true;

	if (sClass ~= "*") then

		for _, sValidClass in pairs(NAME_CLASSES) do

			if (sClass == sValidClass) then
				bRandomClass = false;
				break;
			end

		end

	end

	if (bRandomClass) then
		sClass = NAME_CLASSES[math.random(1, NAME_MAX_CLASSES)];
	end

	if (sLetter ~= "*") then

		for _, sValidLetter in pairs(tLetters) do

			if (sLetter == sValidLetter) then
				bRandomLetter = false;
				break;
			end

		end

	end

	if (bRandomLetter) then
		sLetter = tLetters[math.random(1, 26)];
	end
	
	return tAllNames[sClass][sLetter][math.random(1, tAllNamesCount[sClass][sLetter])];

end


--=========================
-- name.outputToCSV
--=========================
function name.outputToCSV(...)
	local pFolder 		= select(1, ...);
	local bOpenBinary 	= select(2, ...) or false;
	local bAppend	 	= select(3, ...) or false;
	local sOpenType = "w";
	assert(type(pFolder) == "string", "name.outputToCSV error: File path must be a string.");

	if bOpenBinary then
		sOpenType = sOpenType.."b";
	end

	if bAppend then
		sOpenType = sOpenType.."+";
	end

	for sClass, tLetters in pairs(tAllNames) do
		local pFile = pFolder..DIR_SEPARATOR..sClass..'.csv';
		local hFile = assert(io.open(pFile, sOpenType), 'Error in file: '..pFile..'\r\nDestination file could not be created or opened.\r\nPerhaps you do not have the required permissions for this action.');

		if hFile then
			local sOutput = '';

			for sLetter, tNames in pairs(tLetters) do
				sLetter = sLetter

				for nIndex, sName in pairs(tNames) do
					local sComma = ',';

					if (nIndex == tAllNamesCount[sClass][sLetter]) then
						sComma = '';
					end

					sOutput = sOutput..sName..sComma;
				end

			end

			hFile:write(sOutput);
			hFile:close();
		end

	end

end

return name;
